DROP TABLE IF EXISTS `mydoc_area`;
CREATE TABLE `mydoc_area` (
  `id` int(10) NOT NULL DEFAULT '0',
  `pid` int(10) NOT NULL DEFAULT '0',
  `level` int(10) NOT NULL DEFAULT '0' COMMENT '行政级别: 0-国家 1-省级 2-地级 3-县级',
  `level_type` varchar(50) DEFAULT NULL COMMENT '行政划分: 直辖市 省 自治区 特别行政区',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '名称',
  `merger_name` varchar(50) NOT NULL DEFAULT '' COMMENT '完整名称',
  `short_name` varchar(50) DEFAULT NULL COMMENT '简称',
  `merger_short_name` varchar(50) DEFAULT NULL COMMENT '完整简称',
  `en_name` varchar(50) DEFAULT NULL COMMENT '拼音',
  `short_en_name` varchar(50) DEFAULT NULL COMMENT '简拼',
  `initial` varchar(50) DEFAULT NULL COMMENT '首字母',
  `code` varchar(50) DEFAULT NULL COMMENT '区号',
  `zipcode` varchar(50) DEFAULT NULL COMMENT '邮编',
  `longitude` varchar(50) DEFAULT NULL COMMENT '经度',
  `latitude` varchar(50) DEFAULT NULL COMMENT '纬度',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='行政地区数据表';

